import styled from 'styled-components';

export const MoneyScreenBoardContainer = styled.div`
  width: 300px;
  margin-left: 20px;
  padding: 50px;
  border: 2px solid #3f51b5;
`;

export const themeScreenSize = {
  width: '260px',
  height: '40px',
  margin: '20px 0',
  border: '1px solid #000',
  borderRadius: '10px',
};
